<?php

namespace App\Http\Controllers\RecommenderSystem;

use App\Http\Controllers\Controller;
use App\Models\AssociationRule;
use App\Services\AprioriService;

class AprioriController extends Controller
{
    public function analyzeApriori()
    {
        $minSupport = 0.1; // Minimum support threshold nghĩa là một mẫu phổ biến phải xuất hiện trong ít nhất 10% số giao dịch
        $confidence = 0.5;

        //đọc dữ liệu transactions từ file transactions.txt
        //$this->transactions = $this->readTransactions();

        //goi ham removeDuplicates de loai bo cac san pham trung lap trong moi giao dich
        $this->transactions = array_map([$this, 'removeDuplicates'], $this->transactions);

        $aprioriService = new AprioriService($minSupport, $confidence);
        $frequentItemsets = $aprioriService->findFrequentItemsets($this->transactions, $minSupport);
        $associationRules = $aprioriService->generateAssociationRules($frequentItemsets);
        $support = $aprioriService->getSupports();

        //bỏ tiền tố I vd: I1 -> 1 trong associationRules
        $associationRules = array_map(function ($rule) {
            return [
                str_replace('I', '', $rule[0]),
                str_replace('I', '', $rule[1]),
                $rule[2],
            ];
        }, $associationRules);
        
        //xóa hết dữ liệu bảng association_rules
        AssociationRule::truncate();

        //thêm vào bảng association_rules
        foreach ($associationRules as $rule) {
            $antecedent = $rule[0];
            $consequent = $rule[1];
            $confidence = $rule[2];
            AssociationRule::create([
                'antecedent' => $antecedent,
                'consequent' => $consequent,
                'confidence' => $confidence,
            ]);
        }
        
        return response()->json([
            'countTransactions' => count($this->transactions),
            'frequentItemsets' => $frequentItemsets,
            //'supports' => $support,
            'associationRules' => $associationRules,
        ]);

    }

    //hàm loại bỏ các sản phẩm trùng lặp trong mỗi giao dịch
    private function removeDuplicates($transaction)
    {
        return array_unique($transaction);
    }

    private function readTransactions()
    {
        $path = storage_path('app/transactions.txt'); // Đường dẫn tới file
        $content = file_get_contents($path); // Đọc nội dung file
        $transactions = json_decode($content, true); // Giải mã JSON thành mảng PHP

        return $transactions;
    }

